    return user.firstName + ' ' + user.lastName;
}

const user = {
    firstName: 'Nadya',
    lastName: 'ddd'
};

function getGreeting(user) {
    if (user) {
        return <h1>Hi, {formatName(user)}!</h1>;
    }
    return <h1>Hi, noname.</h1>;
}

const element = (
    getGreeting(null)
);

